import React from "react";

class UserSignupPage extends React.Component{

    //each class component must override render
    
    state = {
        username: null,
        agreed: false
    };

    onChangeUsername = event => {
        console.log(event.target.value)
        this.setState({
            username: event.target.value
        })
    };

    onChangeAgreed = event => {
        this.setState({
            agreed:event.target.checked
        })
    };


    /*
    onChangeUsername(event){
        console.log(event.target.value)
    }
    */

    render(){
        return(
            <form> 
                <h1>Sign up</h1>
                <div>
                    <label>Username</label>
                    <input type="text" onChange={this.onChangeUsername}/>
                </div>
                <div>
                    <label>Display Name</label>
                    <input type="text"/>
                </div>
                <div>
                    <label>Password</label>
                    <input type="password"/>
                </div>
                <div>
                    <label>Confirm password</label>
                    <input type="password"/>
                </div>
                <input type="checkbox" onChange={this.onChangeAgreed}/> Agreed

                <button disabled={this.state.agreed}>Sign Up</button>
            </form>
        );
    }

}

export default UserSignupPage;
